?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="color: #333333; font-family: Arial; text-align: left;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта, одна из самых известных компаний, является одной из самых старейших в мире. Ее начало было положено в далеком 1755-ом году. Кстати, ее создание непосредственным образом связано с самой Швейцарией, а точнее, с ее историей. В то время, активно разрасталось кальвинистское общество, а основой этого самого общества, являлось отвержение всяческой роскоши. После долгих разбирательств с производителями роскошных часов, кальвинисты все же поняли, что часы это не дорогая игрушка, а полезный прибор. К 1750-му году, в Женеве насчитывалось около 5-ти тысяч человек, которые, так или иначе, были задействованы в часовой сфере. Среди них особенно выделялся молодой и талантливый часовщик по имени Жан-Марк Вашерон. В 24-летнем возрасте он получил в наследство мастерскую своего отца, и подписал контракт, согласно которому, он должен изготавливать для Женевской часовой фабрики несколько десятков механизмов. Лишь спустя 30 лет, компания смогла наладить самостоятельное производство собственных часов. Но кризис сделал свое дело, то есть немного подкосил компанию Vacheron. Из забвения компанию вывел опытный торговец Константин, который смог добиться налаженного сбыта часов. По сей день, Vacheron Constantin радует часовую общественность своими часами. Элегантность, изящество, сложность, оригинальность невозможно перечислить все синонимы словосочетания Vacheron Constantin.</span></span></span></p>
 
